	add("depression", "{\"term\":\"depression\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027depression\u0027 from Latin \u0027depressio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An area that is lower in topography than its surroundings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was not far from the house; but the ground sank into a \u0027\u0027depression\u0027\u0027 there, and the ridge of it behind shut out everything except just the roof of the tallest hayrick. As one sat on the sward behind the elm, with the back turned on the rick and nothing in front but the tall elms and the oaks in the other hedge, it was quite easy to fancy it the verge of the prairie with the backwoods close by\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In psychotherapy and psychiatry, a state of mind producing serious, long-term lowering of enjoyment of life or inability to visualize a happy future\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In psychotherapy and psychiatry, a period of unhappiness or low morale which lasts longer than several weeks and may include ideation of self-inflicted injury or suicide\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An area of lowered air pressure that generally brings moist weather, sometimes promoting hurricanes and tornadoes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A period of major economic contraction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Four consecutive quarters of negative, real GDP growth. See NBER\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A lowering, in particular a reduction in a particular biological variable or the function of an organ, in contrast to elevation\", \"priority\":8}]}, \"synonyms\":{}}");

