	add("deputation", "{\"term\":\"deputation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027d√©putation\u0027 from \u0027deputatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of deputing, or of appointing or commissioning a deputy or representative; office of a deputy or delegate; vicegerency\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The authority of conscience stands founded upon its vicegerency and \u0027\u0027deputation\u0027\u0027 under God\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The person or persons deputed or commissioned by another person, party, or public body to act in his or its behalf; delegation; as, the general sent a deputation to the enemy to propose a truce\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Among Christian missionaries, the process or period of time during which they raise support in preparation for going to their mission field. This use of the word has been common in churches and mission organizations for over a century, but has recently been giving way to the more \u0026quot;bureaucratic\u0026quot; term \u0026quot;home ministry assignment\u0026quot;. As commonly used, a missionary \u0027does deputation\u0027 or is \u0027on deputation\u0027. However, the missionary is not called a \u0026quot;deputy\u0026quot; nor is the person said to be a part of a \u0026quot;deputation\u0026quot;. Deputation begins when the missionary is officially commissioned to be a missionary, and it ends when the person goes to the mission field\", \"priority\":4}]}, \"synonyms\":{}}");

